column8:
米国コンドル・アウトドア社の高いコストパフォーマンスが魅力なベース2ジッププルオーバーシャツです。<br>
やや厚手のアンダーウェアでレイヤリングシステムでのLevel 2に分類されるミッドベースレイヤーです。<br><br>

通気性にすぐれたハイグリッドフリース素材を採用し、ジッパープルオーバータイプで袖部には親指を出すことのできるサムホールが施されています。 <br><br>

ポリエステルと伸縮性のあるスパンデックスを使用した防寒インナーウェアー、グリット状になったフリースなので軽量で動きやすく、ソフトな肌触りが特徴です 。<br><br>

袖にはサムホールが付き、レイヤリング（重ね着）の時に指を入れて重ね着する事で、袖口のもたつきを無くしスムーズにレイヤリングが可能です。また防寒用としての機能を兼ねています。<br><br>

実寸目安（約 cm）<br>
　　　　肩幅 / 胸幅 / 着丈 / 袖丈  <br>
サイズ S: 42 / 51 / 65 / 59cm<br>
サイズ M: 44 / 53 / 66 / 61cm<br>
サイズ L: 45 / 55 / 66 / 61cm<br><br>

～サイズに関して～<br>
こちらの商品はUS規格のサイズ感で、日本サイズよりもやや大きめになっています。米軍採用品のミッドベースレイヤーとほぼ同じ位のサイジングです。<br><br><style>

