キャブクロージング社の吸汗速乾性に優れたCOOLNICE  Tシャツ！
COOLNICEは乾燥速度がコットンの5倍という脅威の性能があり、汗を素早く吸収して外に出してくれるので、汗によるムレやベタつきがなく、汗冷えによる体力の消耗が起こりにくくなります。<br>
裏面は肌との接地面を最小限に抑えたメッシュ構造。<br><br>
実寸目安（約 cm） <br>
　　　　　 胸幅 / 着丈 <br>
サイズ S: 50 / 69cm <br>
サイズ M: 52 / 71cm <br>
サイズ L: 54 / 73cm <br>
サイズ XL: 57 / 76cm 
※肩幅はラグランスリーブの為計測不可<style>

